import React, { createFactory } from "react";
import "./style.css";
import Avatar from './img/profile-avatar.png';

const Welcome = () => {
    return ( <div id="welMsg" className="m-2 mt-4 mb-4 dashOpacity">
                <div className="welDiv">
                    <div> 
                        <img src={Avatar} alt="">
                        </img>
                    <h1 id="welMsgH1" className="mt-2">Welcome, Rylie!</h1>
                    </div>
                </div>
            </div> );
}

export default Welcome;
